import React from 'react'
import CityCard from './CityCard'

function CityCards() {
    const cities = [
        'bordeaux',
        'brest'
    ]

  return <div className='city-cards'>
    {cities.map((city) => (
        <CityCard key={city} city={city} />
    ))}
  </div>
}

export default CityCards
